import React from 'react';

const FooterTrend = () => {
  return (
    <footer className="footer">
      <nav className="footer-nav">
        <ul className="footer-links">
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </nav>
    </footer>
  );
};

export default FooterTrend;
